def laba():	file = open("01.txt").read().split("\n")	a = [list(map(int, a.split())) for a in file[1:len(file) - 1]]	num = int(file[0].split()[0])	return (a,num)	def _init(a = laba()[0], num = laba()[1]):	global count, roads	count = 0	roads = []	#print(a)	for j in a:		k = [x for x in a]		pos = k.index(j)		#print("Удалено ребро", pos)		k.remove(j)		#print(k)		adj = [[] for x in range(num)]		for i in k:			adj[i[0] - 1].append(i[1])			adj[i[1] - 1].append(i[0])		adj = [sorted(x) for x in adj]		#print(adj)		op(adj, num, pos)	print(count)	for x in roads:		print(x)def dfs(v, visited, k):	visited[v] = True	for w in k[v]:		if not visited[w-1]:  # посещён ли текущий сосед?			dfs(w-1, visited, k)def op(k, num, pos):	global count, roads	for i in range(len(k)):		visited = [False] * len(k)  # массив "посещена ли вершина?"		dfs(i, visited, k)				if visited.count(True) != num:			roads.append(pos)			count += 1			break	_init()